import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Router, hashHistory as history } from 'react-router';
import Routes from './Routes'

ReactDOM.render(
  <Router routes={Routes} history={history}/>,
  document.getElementById('root')
);

